import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";
import Memberroot from './Memberroot';

const Members = ({ url }) => {

    const [allmembersValues, setallmembersValues] = useState([])

    const requests = () => {
        fetchallmemberdata: `/user`
    };

    useEffect(() => {
        async function fetchAllMembers() {
            axios.get(url + requests.fetchallmemberdata).then((res) => {
                setallmembersValues(res.data);
            });
        };
        fetchAllMembers();
    }, []);

    return (
        <>
            <div className="row">
                <Memberroot allmembers={allmembersValues} />
            </div>
        </>
    );
};

export default Members;
